import React from "react";
import "./Header.css";
import { NavLink } from "react-router-dom";
import { TAGS, PAGES } from "../../data";

export default function Header() {
  return (
    <nav>
      <ul>
        {TAGS.map((tag, idx) => (
          <NavLink
            key={tag}
            to={`/${PAGES[idx]}`}
            activeClassName="active"
            className="header-navlink"
          >
            {tag}
          </NavLink>
        ))}
      </ul>
    </nav>
  );
}
